import Vue from 'vue';
import VueRouter from 'vue-router'
import Home from "./components/HelloWorld.vue";
import Home2 from "./components/book.vue";

Vue.use(VueRouter);

const routes = [
    {
        name: "HomeWorld",
        component: Home,
        path: "/"
    },
    {
        name: "Home2World",
        component: Home2,
        path: "/home2"
    },

];

const router = new VueRouter({
    routes,
    mode: "history",
});

export default router;
